import React, { Component} from 'react';
import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';
import NavDropdown from 'react-bootstrap/NavDropdown';
import Button from 'react-bootstrap/Button';
import Form from 'react-bootstrap/Form';
import FormControl from 'react-bootstrap/FormControl';
import SearchBar from './SearchBar';
import FilterDropDowns from './FilterDropDowns';
import {options} from '../Utils/DropDownOprions';

class FilterNavBar extends React.Component {


  constructor(props) {
    super(props);
    this.dropDownOptions=options;
  }

    render() {

      console.log(this.dropDownOptions)
      this.filterDropDownsComponent=this.dropDownOptions.map((parameter)=>(
        <FilterDropDowns details={parameter} key={parameter.id}/>
      ))

        return(

            <Navbar bg="light" expand="lg">
  <Navbar.Brand href="#home">Filter Search</Navbar.Brand>
  <Navbar.Toggle aria-controls="basic-navbar-nav" />
  <Navbar.Collapse id="basic-navbar-nav">
    <Nav className="mr-auto">
      <FilterDropDowns title="Domain"/>
      <FilterDropDowns title="Researcher Type"/>
      <FilterDropDowns title="Status"/>
    </Nav>
    <SearchBar/>
  </Navbar.Collapse>
</Navbar>

        )
    }
}
export default FilterNavBar;
